uint32_t colormap[] = {0x2902FE, 0x9A0779, 0xFB0002, 0x2902C2, 0xCB101F, 0x971518, 0x090310, 0x40393B, 0x6A6A6B, 0xA5A0A2, 0xF6F6F7, 0x150187, 0xBAAAFC, 0xB8716F, 0x6155A7};
void drawPepsiman(int x_start, int y_start, int size)
{
    for (int x = x_start, i = 0; x < x_start + 100 * size; i++)
    {
        for (int y = y_start, j = 0; y < y_start + 100 * size; j++)
        {
            call_putpixelResizable(colormap[pepsiman[j][i]], x, y, size);
            y += size;
        }
        x += size;
    }
}

uint32_t pepsoscolors[] = {0xfffefefe, 0xffeb301b, 0xff1a2c9c, 0xff0a26e8};
void drawPepsos(int x_start, int y_start, int size)
{
    for (int x = x_start, i = 0; x < x_start + 140 * size; i++)
    {
        for (int y = y_start, j = 0; y < y_start + 40 * size; j++)
        {
            call_putpixelResizable(pepsoscolors[pepsos[j][i]], x, y, size);
            y += size;
        }
        x += size;
    }
}

uint32_t fancycolors[] = {0xfffefefe, 0xff8c8420, 0xffe6d838, 0xff898f5e, 0xffc1bc65, 0xfffefec7, 0xffcdbf21, 0xff844b0d};
void drawFancyMenu(int x_start, int y_start, int size)
{
    for (int x = x_start, i = 0; x < x_start + 45 * size; i++)
    {
        for (int y = y_start, j = 0; y < y_start + 25 * size; j++)
        {
            if (fancymenu[j][i] != 0)
            { // deberia skippear el espacio vacio
                call_putpixelResizable(fancycolors[fancymenu[j][i]], x, y, size);
            }
            y += size;
        }
        x += size;
    }
}
